import React from "react";

const Card = (props) => {
  return (
    <>
      <div className="card">
        <div className="card_img">{props.logo}</div>
        <div className="card_label">{props.label}</div>
        <div className="card_des">{props.description}</div>
      </div>
    </>
  );
};

export default Card;
